import styled from 'styled-components'
import InfoBox from './components/InfoBox'
import UserImageBox from './components/UserImageBox'
import {contactInfo} from './services/const'

function App() {
  return (
    <div className="App">
      <Wrapper>
        <FirstColumn>
          <UserImageBox />
          <InfoBox />
        </FirstColumn>
        <SecondColumn />
      </Wrapper>
    </div>
  );
}

const Wrapper = styled.div`
  display: flex;
`

const FirstColumn = styled.div`
flex: 5;
max-width: 41.66%;
width: 41.66%;
`

const SecondColumn = styled.div`
flex: 7;
max-width: 58.33%;
width: 58.33%;
`


export default App;
